$(".list-work-account").click(function(){$(".child-acc").slideToggle("child-acc-open")});if($("#donutchart").length){google.charts.load("current",{packages:["corechart"]});google.charts.setOnLoadCallback(drawChart);var dataFinish=parseInt($(".data-finish").text());var dataProcessed=parseInt($(".data-processed").text());var dataProcessing=parseInt($(".data-processing").text());function drawChart(){var a=google.visualization.arrayToDataTable([["Task","Hours per Day"],["Hoàn thành",dataFinish],["Đã xử lý",dataProcessed],["Chưa xử lý",dataProcessing]]);var t={pieHole:.4,colors:["#46cb6c","#4099de","#e17e00"],legend:"bottom"};var e=new google.visualization.PieChart(document.getElementById("donutchart"));e.draw(a,t)}}if($("#donutchart1").length){google.charts.load("current",{packages:["corechart"]});google.charts.setOnLoadCallback(drawChart1);var dataProcessedLate=parseInt($(".data-processed-late").text());var dataProcessingLate=parseInt($(".data-processing-late").text());function drawChart1(){var a=google.visualization.arrayToDataTable([["Task","Hours per Day"],["Đã xử lý",dataProcessedLate],["Chưa xử lý",dataProcessingLate]]);var t={pieHole:.4,colors:["#4099de","#e17e00"],legend:"bottom"};var e=new google.visualization.PieChart(document.getElementById("donutchart1"));e.draw(a,t)}}if($("#chart_div").length){google.charts.load("current",{packages:["corechart","line"]});google.charts.setOnLoadCallback(drawBasic);var allData=[];$("#list-chart").find(".thang").each(function(a){var t=$(this).attr("data");var e=t.split(",");var r=$(this).attr("month");var o=[];for(var a=0;a<e.length;a++){e[a]=parseInt(e[a]);o.push(e[a])}o.unshift(r);allData.push(o)});var arrFirst=["Tháng","Tổng số báo cáo chỉ đạo","Báo cáo trễ hạn","Báo cáo đúng hạn"];allData.unshift(arrFirst);function drawBasic(){var a=google.visualization.arrayToDataTable(allData);var t={curveType:"function",height:350,legend:{position:"bottom"},backgroundColor:["#1d89f2","#e14d34","##30bca4"],startDuration:0,vAxis:{gridlines:{count:8},viewWindow:{min:0}},chartArea:{height:"75%"}};var e=new google.visualization.LineChart(document.getElementById("chart_div"));e.draw(a,t)}}$(".datepicker").datepicker({format:"dd/mm/yyyy"});$(".arr-btn").click(function(){$(this).toggleClass("icon-arrup").toggleClass("icon-arrdown");$(this).parent().parent().find(".tg-list").toggleClass("none-list")});